【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>【J32SK02の説明】<br />★ 本製品は「高画質で視聴する」ことに特化したシンプル設計の液晶テレビです。映像エンジンに東芝LSI製のスケーラーを採用し直下型LEDバックライトとIPSパネルで高画質化を実現。テレビの外枠は薄枠スリムベゼルを採用し、シンプルでスタイリッシュに仕上げ、PC機器やAV機器と違和感なくマッチする質感に仕上げました。<br /><br />★ シングルチューナーを搭載しているので、USB外付けハードディスク（別売）を接続する事で番組録画ができます。番組表から簡単に予約できたり、連続ドラマを最終回まで追跡録画する「連ドラ予約」機能がついているので、番組の録り逃しを回避します。<br /><br />★ HDMI入力端子は2系統搭載しております。1080/60pはもとより、1080/24p（ブルーレイディスクの映画ソフトなど、24コマの映像出力）にも対応。またHDMIの接続機器をテレビと同時に電源オフすることが可能なCEC※機能を搭載し、うち1系統はARC対応となっています。<br />（※接続側機器もCECに対応していること）<br /><br />★ 病院やホテルのベッドサイドテレビとしてのご使用も考えて設計したエンジニアモード(ホテルモード)や、B-CASカードの盗難防止・紛失防止用のフォルダも標準付属品としており、個人のみならず法人用途にも適したテレビです。<br /><br />★ リモコンは年配のお客様でもお使いいただきやすいよう「シンプル設計」。必要最低限のキー配置、押しやすさを重視したボタンサイズで操作に戸惑うことはありません。<br /><br />★ その他見やすさを重視したEPG(電子番組表)やオフタイマーの他、データ放送や目覚まし代わりに便利なオンタイマー機能、画面に時計表示※をさせることも可能です。※テレビ視聴時のみ<br /><br /><br />* 種類: 地上・BS・110度CS デジタルハイビジョン液晶テレビ<br />* 液晶パネル: 画面サイズ32V<br />* バックライト: 直下型LEDバックライト<br />* 駆動方法: IPS<br />* 画素数: 1366(H)×768(V)<br />* 応答速度: 8ms Gray to gray(BW)<br />* 視野角(最小値): 左右約 178° (MIN) / 上下約 176° (MIN)<br />* 輝度(最大値): 250cd/m2<br />* コントラスト比<br />* (標準値): 1200 :  1<br />* 地上波デジタル: 地上デジタル: UHF(13～62ch)<br />* CATVパススルー(VHF、 UHF)対応共有<br />* BS デジタル: BSデジタル: BS000～BS999<br />* 110° CS デジタル: 110度 CS デジタル: CS000～CS999<br />* 音声出力(スピーカー): 10W+10W<br />* 入力・出力端子: ビデオ入力映像:  1V(p-p)、75Ω、負同期<br />* 音声:  500mV(rms)、22kΩ以上(インピーダンス)<br />* HDMI入力×3: HDMI CEC対応 ARC対応(HDMI 1のみ)<br />* HDMI: 対応入力解像度<br />* 480i、 480p、 720p、 1080i、 1080/60p、 1080/24p<br />* USB(録画専用)端子×1録画用外付けHDD専用<br />* ヘッドホン出力: ヘッドホン端子口径 3.5mm ステレオミニジャック、<br />* 適合インピーダンス: 16Ω～<br />* HDD録画機能※: 留守録対応(シングルチューナー)、番組表から録画予約可能(最大録画予約件数64)、最大録画番組数1000(最大2TBまでの外付けHDD対応)、日時指定予約機能、自動削除/保護機能、放送時間連動機能、レジューム再生、追っかけ再生、頭出し再生、ワンタッチスキップ機能、HDD省エネ設定機能<br />* データ放送: 双方向データ放送(BML)対応<br />* 番組表: 電子番組表(EPG)対応: 7チャンネル6時間分表示(6チャンネル6時間切替)、8日分受信、視聴予約可能、双方向データ放送(BML)対応<br />* 使用条件: 温度:  0℃～35℃/-20℃～45℃ 湿度: 20%～80%RH/10%～90%RH (結露のないこと)<br />* 高度: 0～2000m/0～3.790m<br />* サイズ(W.H.D: 735.7mm × 486mm × 220mm<br />* 質量(重量): 5.5kg(NET)/ 7.2kg(総重量)<br />* 消費電力: (待機電力)60W(0.3w)<br />* 年間消費電力: 36kWh/年<br />* 付属品: リモコン、リモコン用単4乾電池×2個、B-CASカード×1枚、B-CASカード紛失防止ホルダー×1個、B-CASカード紛失防止ホルダー固定用ネジ×1個、スタンドベース×2個、スタンドベース固定ネジ×4個、取扱説明書×1部、保証書×1部<br />－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－<br /><br />【HD-LC2.0U3-BKE の説明】<br />★ テレビ&パソコンどちらでも使える<br />本製品はテレビでもパソコンでも使える両対応。幅広い対応機種で快適なデジタルライフをサポートします。テレビに繋ぐ場合は録画用のHDDとして、またパソコンに繋げる場合は便利なユーティリティで快適に利用できます。<br />※テレビで録画用に初期化した場合、パソコンで使用することは出来ません。また、パソコンで初期化した場合、テレビでの録画に使用することは出来ません。<br /><br />★ ターボPC EX2 Plusがファイル転送効率化を実現<br />保存容量が最大20%もアップするセーブモード、保存時間が短縮できるスピードモード。お好みでお選びいただけます。<br /><br />★ 置き方が選べる。タテ置き・ヨコ置き両対応<br />パソコンやデジタル家電など、HDDがつながる機器のそばの隙間にさり気なく置けるスリムボディー。さらにタテ置き・ヨコ置き両対応で好みの置き方を選べます。パソコンが置かれている机の上やパソコンのそば、テレビ画面の下の隙間やAVラックの中など、場所を選ばず自由に設置できます。<br /><br />★ データを隠しウイルスや不正侵入から守る<br />添付されている「Secure Lock +Guard」を使えば、大事なファイルを「暗号化ボックス」に隠すことができます。保存されたファイルは、解読が困難なAES256bit方式で暗号化され、ソフトウェアからしか操作できません。データをOSから「隠す」ことにより、データがウイルスや不正侵入者による破壊活動・情報流出活動の対象となることを防ぐことができます。<br />※理論上によるものです。すべてのウイルスによるデータ流出・破壊・感染活動や、不正侵入攻撃から守られるわけではありません。<br /><br /><br />* 接続方式：USB2.0/USB3.0<br />* 記録容量：2TB<br />* 対応機種:<br />　USB3.0/2.0端子搭載のWindowsパソコン、Mac(Intelプロセッサー搭載機のみ)<br />* USB部<br />　・インターフェース:USB3.0/2.0<br />　・端子数:1<br />　・端子形状:USB 3.0 MicroB<br />　・ファイルシステム:NTFS<br />* 転送速度(規格値)<br />　・USB3.0:最大5.0Gbps<br />　・USB2.0:最大480Mbps<br />* 電源:AC100V 50/60Hz<br />* 最大消費電力:18W<br />* エネルギー消費効率:B区分 0.0032<br />※エネルギー消費効率とは、省エネ法で定める測定方法により測定した消費電力を省エネルギー法で<br />　定める記憶容量で除したものです。<br />* 外形寸法:39×120×187mm※本体のみ(突起部除く)<br />* 重量:約1.0kg<br />* 動作環境:温度5～35℃、湿度20～80%(結露なきこと)<br />* グリーン購入法:対応<br />* RoHS指令準拠:対応<br />* 主な付属品:USBケーブル(1m)、ACアダプター、取扱説明書<br />※ユーティリティーはすべてダウンロードにて提供<br />　(ターボPC EX2 Plus、バックアップユーティリティー、ディスクフォーマッター2、<br />　SecureLock+Guard、ファイナルデータ(無料試供版)、ウイルスバスター(体験版)、取扱説明書)<br />－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－－</p></div><!-- 商品説明 ここまで --><!-- 共通説明文（大）-->
